import "./Dictionary.css";

export default function Dictionary() {
    function search(event){
        event.preventDefault()
    }
    return (
        <div className="Dictionary">
          <form onSubmit={search}>
            <input typ="search" autoFocus={true} />
          </form>
        </div>
    );
}
